fun binaryToChar(bin: String): Int {
    var result = 0
    bin.reversed().forEachIndexed { i, c ->
        result += Integer.parseInt(c.toString()) * 2.0.pow(i).toInt()
    }
    return result
}

fun printRespDec(hexString: String, decKey: String) {
    val d = if (decKey.contains("\n") && decKey.contains(": ")) decKey.split("\n")[0].split(": ")[1] else decKey
    val decrypt = kbinDecodeToString(Rc4.decrypt(hexStringToBytes(hexString), d))
    println(decrypt)
}

fun printRespDecompressDecrypt(hexString: String, decKey: String) {
    val d = if (decKey.contains("\n") && decKey.contains(": ")) decKey.split("\n")[0].split(": ")[1] else decKey
    val decrypt = kbinDecodeToString(
        Lz77.decompress(
            Rc4.decrypt(hexStringToBytes(hexString), d)))
    println(decrypt)
}

fun printRespDecompress(hexString: String) {
    val hexBytes = hexStringToBytes(hexString)
    val decomp = Lz77.decompress(hexBytes)
    println(kbinDecodeToString(decomp))
}

fun printResp(hexString: String) {
    println(kbinDecodeToString(hexStringToBytes(hexString)!!))
}

fun convertRequestNode(hexString: String): Element {
    val requestBody = Lz77.decompress(hexStringToBytes(hexString))
    val rootNode = if (XmlUtils.isBinaryXML(requestBody)) {
        XmlUtils.stringToXmlFile(kbinDecodeToString(requestBody))
    } else {
        XmlUtils.byteArrayToXmlFile(requestBody)
    }
    return rootNode.firstChild as Element
}

fun printDocument(doc: KXmlBuilder):String {
    val bos = ByteArrayOutputStream().also {
        val transformerFactory = TransformerFactory.newInstance()
        val transformer = transformerFactory.newTransformer()
        transformer.setOutputProperty(OutputKeys.METHOD, "xml")
        val source = DOMSource(doc.document)
        val result = StreamResult(it)
        transformer.transform(source, result)
    }
    return bos.toString(Charset.defaultCharset())
}


fun hexStringToBytes(hexString: String?): ByteArray? {
    var hxs = hexString
    if (hxs == null || hxs == "") {
        return null
    }
    hxs = hxs.uppercase(Locale.getDefault())
    val length = hxs.length / 2
    val hexChars = hxs.toCharArray()
    val d = ByteArray(length)
    for (i in 0 until length) {
        val pos = i * 2
        d[i] = (charToByte(hexChars[pos]).toInt() shl 4 or charToByte(hexChars[pos + 1]).toInt()).toByte()
    }
    return d
}

fun charToByte(c: Char): Byte {
    return "0123456789ABCDEF".indexOf(c).toByte()
}
